export const getPostList = (state) => isObj(state, 'postList', false);
export const getPostError = (state) => isObj(state, 'postError', false);
export const getPostSuccess = (state) => isObj(state, 'postSuccess', false);
export const getpostDetails = (state) => isObj(state, 'postDetails', false);
